     // R\xf8re rundt p\xe5 rekkef\xf8lgen\n            Collections.shuffle(wordList);\n\n            // s\xe5 lenge wordList er under 16 ord\n            while (wordList.size() < 16) {\n                // legg til flere ord\n                wordList.addAll(Arrays.asList(wordsArray));\n            }\n\n            // Bruke StringBuilder fremfor konkatenasjon for ytelse (fordi vi slipper \xe5 skape nye objekter for hver string)\n            // StringBuilder skal vi bruke for \xe5 legge til tekst i poemArea.\n            StringBuilder poem = new StringBuilder(); // instantierer objekt\n            // 4 ord p\xe5 4 linjer er 16 ord\n            // derfor \xf8ker vi i med 1 for hvert ord\n            for (int i = 0; i <16; i++) {\n                // etter wordList har 16 elementer appendes dette til poem-StringBuilderobjektet\n                poem.append(wordList.get(i));\n\n                // Algoritmen for diktstrukturen\n                // Vi kan enkelt sette inn newlinekarakteren for \xe5 f\xe5 en ny linje etter hvert fjerde ord ved \xe5 bruke\n                if ((i + 1) % 4 == 0) {\n                    // og om regnestykket stemmer setter vi inn ny linje\n                    poem.append("\\n");\n                } else {\n                    // ellers setter vi bare inn mellomrom til if-testen blir true\n                    poem.append(" ");\n                }\n            }\n\n            // Gj\xf8r om dikt til string og setText inn i poemArea\n            poemArea.setText(poem.toString());\n\n            }\n        });\n\n\n    }\n\n\n}\n\n// Kristian Martin Tvenning\n',language:"java",showLineNumbers:!0,maxHeight:"500px"}),(0,ot.jsx)("p",{children:"LeggTilOrdVindu.java"}),(0,ot.jsx)(by,{code:'\n// Arbeidskrav for anledning til \xe5 fremstille seg til eksamen i OBJ2000\n// Obligatorisk oppgave 1: Diktgenerator\n// Kristian Martin Tvenning\n\n// Tilretteleggelse\nimport javax.swing.*; // for GUI\nimport java.awt.*; // for GUI (spesifikt GridBagLayout)\nimport java.awt.event.ActionEvent; // * importerer ikke underpakker s\xe5 vi importerer dem spesifikt\nimport java.awt.event.ActionListener; // ActionEvent og -Listener beh\xf8ves for JButton-funksjoner vi skal bruke\n\npublic class LeggTilOrdVindu {\n\n    // Opprette array for tekststrenger (ordliste)\n    private static String[] wordsArray;\n\n    public static void opneAddWordsWindows() {\n        // Opprette rammen leggTilOrdFrame og titulere den "Legg til ord"\n        JFrame leggTilOrdFrame = new JFrame("Legg til ord");\n        // sette Layout som manager og opprette GridBagLayoutobjekt\n        leggTilOrdFrame.setLayout(new GridBagLayout());\n        // Opprette objektinstans kalt gbc\n        GridBagConstraints gbc = new GridBagConstraints();\n\n        JTextField[] wordFields = new JTextField[16];\n\n\n        // I stedet for \xe5 legge til 16 forskjellige JLabels bruker vi en for-l\xf8kke med counter og ++\n        for (int i = 0; i < 16; i++) {\n            // Kolonneplassering horisontal er konstant s\xe5 den er 0\n            gbc.gridx = 0;\n            // Kolonneplassering vertikalt er variabel i\n            gbc.gridy = i;\n\n\n            // Justering for at "Ord 1: " label skal v\xe6re som de andre:\n            gbc.fill = GridBagConstraints.NONE;\n            // "Ankre" label-tekst til h\xf8yre i kolonnen\n            gbc.anchor = GridBagConstraints.LINE_END;\n            // sette inn "Ord 1:, Ord 2:, osv\n            leggTilOrdFrame.add(new JLabel("Ord " + (i + 1) + ": "), gbc);\n\n            gbc.weightx = 1.0;\n            gbc.weighty = 1.0;\n\n            // L\xf8kken brukes ogs\xe5 for JTextField\n            // men vi setter JTextField i kolonne 2, indeks 1\n            gbc.gridx = 1;\n            // og sier at JTextField skaleres iht kolonnest\xf8rrelsen i vinduet ("strekkes")\n            gbc.fill = GridBagConstraints.HORIZONTAL;\n            wordFields[i] = new JTextField(20);\n            leggTilOrdFrame.add(wordFields[i], gbc);\n        }\n\n        // Avbryt-knapp\n        JButton cancelButton = new JButton("Avbryt");\n        gbc.gridx=2;\n        gbc.gridy = 18;\n        // gbc distribuerer ikke knappebredde jevnt s\xe5 la oss spesifisere at\n        gbc.weightx = 0.5;\n        // og add\'e cancelButton til i leggTilOrdFrame\n        leggTilOrdFrame.add(cancelButton, gbc);\n\n        // Knapp for \xe5 gjennomf\xf8re handling (legge til i ordlista som skal brukes for nytt dikt)\n        JButton submitButton = new JButton("Legg inn ord");\n        // Hvor "Legg inn ord"-knappen skal plasseres\n        gbc.gridx = 3;\n        gbc.gridy = 18;\n        // Ledeteksten har en gridwidth p\xe5 2 og weightx for cancelButton er satt til 0.5\n        // s\xe5 la oss sette submitButton til 0.5 for 50/50 fordeling av knappest\xf8rrelse\n        gbc.weightx = 0.5;\n        // Adde submitButton til leggTilOrdFrame\'n\n        leggTilOrdFrame.add(submitButton, gbc);\n\n        // Legge vekt p\xe5 gode ledetekster for bruker\n        JTextArea ledetekst = new JTextArea(" Du m\xe5 skrive inn minst ett ord.\\n " +\n                "Det fungerer best med mellom seks og \xe5tte ord.");\n        // Skal bare vise tekst og ikke noe vits i \xe5 forandre teksten\n        ledetekst.setEditable(false);\n        // JTextArea gir hvit bakgrunnsfarge og "monospace font" og det er ikke \xf8nskelig for gjennomg\xe5ende grafisk tema\n        // og derfor setter vi bakgrunn ved \xe5 gette bakgrunnen til contentpane fra leggTilOrdFrame\n        ledetekst.setBackground(leggTilOrdFrame.getContentPane().getBackground());\n        gbc.gridx = 2;\n        gbc.gridy = 0;\n        gbc.gridwidth = 2;\n        gbc.gridheight = 2;\n        leggTilOrdFrame.add(ledetekst, gbc);\n\n        // Legge vekt p\xe5 gode ledetekster for bruker\n        // "Felle" er \xe5 skrive inn bare substantiver\n        JTextArea ledetekst2 = new JTextArea(" Pr\xf8v \xe5 varier mellom ordklasser.\\n" +\n                " Varier bruk av substantiver, verb og adjektiv.");\n        ledetekst2.setEditable(false);\n        // Sette JTextArea til samme farge som frame for en mer gjennomg\xe5ende look and feel\n        ledetekst2.setBackground(leggTilOrdFrame.getContentPane().getBackground());\n        gbc.gridx = 2;\n        gbc.gridy = 4;\n        // Spesifisere tekstens utstrekking i GUI-laget (sprer utover 2 kolonner og rader)\n        gbc.gridwidth = 2;\n        gbc.gridheight = 2;\n        // og adder ledetekst 2 til leggTilOrdFramen via GridBagConstrains\n        leggTilOrdFrame.add(ledetekst2, gbc);\n\n        // submit "leverer inn" ordene til ordlista\n        submitButton.addActionListener(new ActionListener() {\n            @Override\n            public void actionPerformed(ActionEvent e) {\n                String[] tempArray = new String[16];\n                int wordCount = 0;\n                for (int i = 0; i < 16; i++) {\n                    String word = wordFields[i].getText().trim();\n                    if (!word.isEmpty()) {\n                        tempArray[wordCount++] = word;\n                    }\n                }\n                if (wordCount < 1) {\n                    // om wordCount er < 1 f\xe5r man beskjed om at man trenger minst ett ord for \xe5 lage dikt\n                    // men gir ledetekst for "bedre dikt"\n                    JOptionPane.showMessageDialog(leggTilOrdFrame, "Du m\xe5 fylle inn minst et ord.\\n " +\n                            "Fra og med 6 til og med 8 fungerer best.");\n                } else {\n                    wordsArray = new String[wordCount];\n                    System.arraycopy(tempArray, 0, wordsArray, 0, wordCount);\n                    // Kontrollprint:\n                    // System.out.println("Ord som har blitt tastet inn: " + String.join(", ", wordsArray));\n                    // Ledetekst som bekrefter brukerens handling\n                    JOptionPane.showMessageDialog(leggTilOrdFrame, "Ord lagt til!");\n                    leggTilOrdFrame.dispose();\n      